import './About.css';

import { Col, Container, Row } from "react-bootstrap";

import About1 from '../Image/about.png';

function About(){
    return(
        <Container fluid>
            <Container>
                <div className = "about">
                <Row>
                    <Col xl = "4" lg = "4" md = "6" sm = "12">
                        <img src = {About1} className = "w-100"/>
                    </Col>
                    <Col xl = "4" lg = "4" md = "6" sm = "12"></Col>
                </Row>
                </div>
            </Container>
        </Container>
    )
}

export default About
